import React from 'react';
import './Card.css';

function Card({ customers }) {
  return (
    <div>
   
      <h3 className="heading">Welcome Dareen</h3>
      <p className="paragraph">You have been logged in for{customers.length} customers</p>
    </div>
  );
}

export default Card;
